import React from 'react';

const ImageList = (props) => {
    console.log(props)
    return (
        <div>
            {props.images.map(({tags, largeImageURL}) => {
                return (
                    <img className="imageList__image" src={largeImageURL} alt={tags} />
                )
            })}
        </div>
    )
}

export default ImageList
